import React from "react";

function MobileSubscribers() {
  return (
    <div className="my-10">
      <div className=" h-full">
        <div className="grid grid-cols-3 gap-4">
          <div className="col-span-2">
              <div className="flex">
                    <div>
                        <input placeholder="Search mobile" className="h-10 bg-red-500 w-96 rounded-lg" />
                    </div>
                    <div>
                        <button className="bg-blue-700 w-40 rounded-lg h-10 ml-5 text-w">Search</button>
                    </div>
              </div>
          </div>
          <div className="bg-red-500 rounded-lg">05</div>
        </div>
      </div>
    </div>
  );
}

export default MobileSubscribers;
